  assemblies:
  - csDBPF
  namespace: csDBPF
  summary: >-
    Size of the block including this header, only used if the file contains an attachment or embedded mipmaps; it is zero otherwise.<br /><br />

    - For single images this is usually: width x height + 10h(hex).<br />

    - For images with embedded mipmaps, this is the total size of the original image, plus all mipmaps, plus the header.<br /><br />

    In either case, it may include additional data as a binary attachment with unknown format.
